Let $f: \mathbb{Z} \rightarrow \mathbb{Z}$ be a function and let $g: \mathbb{Z} \rightarrow \mathbb{Z}$ be given by
\[ g(x) = \begin{cases} 
f(0) & \text{if } x \text{ is even} \\
f(1) & \text{if } x \text{ is odd}
\end{cases} \]
Prove that \(f(x) = g(x)\) for all integers \(x\).

