Let $\mathcal{S}$ be the set of all points in the coordinate plane $(x,y)$ such that all of the following conditions hold: \begin{enumerate}
\item $x$ is a multiple of 2,
\item $y$ is a multiple of 3,
\item $xy = x+y+1.$
\end{enumerate}
Determine whether the area of $\mathcal{S}$ is finite or infinite. Justify your answer.

