Given nonnegative integers $a, b, c, d$, find all solutions to the system
\begin{align*}
a + b &= c + d + 1, \\
ab + cd &= 1,
\end{align*}
where $c$ is divisible by $a$. Input should be $a$ and $b$, and the answer should be $(c, d)$.

